function Valikot(props) {
  function lisaaPaikat() {
    const maakunnat = this.props.paikat;
    maakunnat.map((paikka) => {
      console.log("Makaunta:", paikka.maakunta);
    });
  }

  return (
    <div>
      <select value="Testi">{lisaaPaikat}</select>
    </div>
  );
}

export default Valikot;
